import React from 'react'
import { Router, Route, Switch } from "react-router-dom";
import Home from "./components/home/Home"
const App = () => {
  return (
    <>
     <Router>
       <Switch>
         <Route exact path="/" component={Home} />
       </Switch>
     </Router>
    </>
  )
}
export default App;
